                    <div className="col-md-12">
                        <div class="panel-info btn-default">
                            <div class="panel-heading main-text">SEARCHED DONOR</div>
                                <div class="panel-body">
                                        
                            </div>
                        </div>
                    </div>
                </div>
            </div>
        );
    }
}

export default home;
